import logo from './pbk_052121_WhiteBg.svg';
import {useState, useEffect} from 'react';
import './App.css';
import Form from './components/Form';


function App() {

  const [results, setResults] = useState([])



  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      <div className="row">
	<div className = "col">
	<h1>Coming Soon</h1>
	</div>
	<div className="col">
	<Form results = {results}/>
	</div>
      </div>
      </header>
    </div>
  );
}

export default App;
